import React, { ReactElement } from 'react';
import classNames from 'classnames';

import './styles.scss';

interface IProps {
  className?: string;
  course: string;
  title: string;
  imageSrc: string;
}

function CourseCard(props: IProps): ReactElement {
  return (
    <div className={classNames('course-card', props.className)}>
      <div className="course-card__image-wrapper">
        <img
          className="course-card__image"
          src={props.imageSrc}
          alt={props.course}
        />
      </div>
      <div className="course-card__content">
        <span className="course-card__course">{props.course}</span>
        <h4 className="course-card__title">{props.title}</h4>
      </div>
    </div>
  );
}

export default CourseCard;
